                Result := True;
        finally
                Qry.Free;
        end;
end;

class function  T@nameclass.GetCount : integer;
var
  Qry: TUniQuery;
begin
  Qry := DM.NewQuery;
  try
    Qry.SQL.Text := ' select count(*) as c from   @nametable ';
    Qry.Open();
    if Qry['c'] <> NULL then
      Result := Qry['c']
    else
      Result := 0;
  finally
    Qry.Free;
  end;

end;


class function  T@nameclass.first: T@nameclass;
begin
        Result := T@nameclass.Get@nameclass( 0 );
end;

class function  T@nameclass.last: T@nameclass;
begin
        Result := T@nameclass.Get@nameclass( 1 );
end;

class function  T@nameclass.Get@nameclass( aValue:integer ): T@nameclass;
var
  Qry: TUniQuery;
begin

  Qry := DM.NewQuery;
  try
    Qry.SQL.Text := ' select ID from @nametable ';
    Qry.Open();
    if aValue = 0 then
        Qry.first
    else
        Qry.last ;
    Result :=  T@nameclass.Create(Qry.FieldByName('ID').Asstring);
  finally
    Qry.Free;
  end;

end;

class function  T@nameclass.@nameclasss : TStrings ;
var
  Qry: TUniQuery;
  @nameclass: T@nameclass;
begin
  Result := TStringList.Create;
  Qry := DM.NewQuery;
  try
    Qry.SQL.Text := ' select ID from  @nameclasss ';
    Qry.Open();
    while not Qry.Eof do
    begin
      @nameclass := T@nameclass.Create(Qry['ID']);
      Result.AddObject(@nameclass.ID, @nameclass);
      Qry.Next;
    end;
  finally
    Qry.Free;
  end;
end;



