function T@nameclass.Get@fieldname: TStream;
var
  Qry: TUniQuery;
  s: TStream;
begin
  Qry := DM.NewQuery;
  try
    try
      Qry.SQL.Text := ' select  @fieldname from  @nameclasss  where ID = :ID ';
      Qry.ParamByName('ID').Value := FID;
      Qry.Open();
      if Qry.RecordCount > 0 then
      begin
        s := Qry.CreateBlobStream(Qry.FieldByName('@fieldname'), bmRead);
        try
          s.Position := 0;
          F@fieldname.CopyFrom(s, s.Size);
        finally
          s.Free;
        end;
      end;
    except
      raise Exception.Create('Error Load @fieldname  ');
    end;
  finally
    Qry.Free;
  end;
  F@fieldname.Position := 0;
  Result := F@fieldname;

end;

